import React, { useRef } from "react";
import { useGLTF } from "@react-three/drei";

export default function Model(props) {
    const group = useRef()
    const { nodes, materials } = useGLTF("/clayplate.gltf")
    const [colour, setColour] = useState("#f8f8ff")

    return (
        <group ref={group} {...props} dispose={null}>
            <group rotation={[-Math.PI / 2, 0, 0]}>
                <mesh geometry={nodes.Object_2.geometry} material={nodes.Object_2.material} position={[-0.0037, 0.0251, -0.0048]}>
                    <mesh onClick={() => { colour === "#f8f8ff" ? setColour("#87cefa") : setColour("#f8f8ff") }} geometry={nodes.Object_2.geometry} material={nodes.Object_2.material} material-color={colour} />
                </mesh>
                <mesh
                    castShadow
                    receiveShadow
                    geometry={nodes.Object_2.geometry}
                    material={materials.defaultMat}
                />
            </group>
        </group>
    );
}

useGLTF.preload("/clayplate.gltf")
